import styled from "styled-components";
import {
  space,
  color,
  typography,
  border,
  shadow,
  layout,
  position,
} from "styled-system";

const Box = styled('div')`
  ${space}
  ${color}
  ${typography}
  ${border}
  ${shadow}
  ${layout}
  ${position}
`

Box.displayName = 'Box'

export default Box
